import { Content } from "antd/es/layout/layout";
import React from "react";

const PostCard = () => {
  return (
    <div>
      <Card>
        <Image />
        <Content />
        <Button></Button>
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
